// the card class with information about the card
// default values
export class Card {
  constructor() {
    this.cardName = "";
    this.cardSprite = null;
    this.Accuracy = 0;
    this.Retaliation = 0;
    this.Damage = 0;
    this.HealthPoints = 0;
    this.rarity = null; 
    this.Trigger = "";
    this.Effect = "";
  }
}
